import React from 'react';
import { Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

const Header = () => {
  return (
    <nav className="navbar">
      <div className="container-fluid">
        <a href="#">
          <img src="studeo-spaces\src\assets\logo\studeo-spaces-logo.png" alt="Studeo Spaces Logo" style={{ height: '50px', width: '50px' }} />
        </a>
        <div>
          <ul className="navbar-nav">
            <li className="nav-item">
              <Link to="/" className="nav-link">Home</Link>
            </li>
            <li className="nav-item">
              <Link to="/blogs" className="nav-link active-nav">Blogs</Link>
            </li>
            <li className="nav-item">
              <Link to="/services" className="nav-link">Services</Link>
            </li>
            <li className="nav-item">
              <Link to="/faqs" className="nav-link">FAQs</Link>
            </li>
            <button className="btn btn-primary-clr">Book now!</button>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Header;
